CREATE TABLE catalog_item_entity
(
   id        BIGINT         NOT NULL,
   brand     VARCHAR(255),
   category  VARCHAR(255),
   image     MEDIUMTEXT,
   name      VARCHAR(255),
   price     BIGINT,
   quantity  BIGINT,
   text      VARCHAR(255),
   model     VARCHAR(255),
   PRIMARY KEY (id)
);

CREATE TABLE user_entity
(
   id        BIGINT         NOT NULL,
   address   VARCHAR(255),
   name      VARCHAR(255),
   password  VARCHAR(255),
   role      VARCHAR(255),
   PRIMARY KEY (id)
);
CREATE TABLE order_item_entity
(
   id        BIGINT     NOT NULL,
   created   DATETIME,
   order_id  BIGINT,
   item_id   BIGINT,
   user_id   BIGINT,
   PRIMARY KEY (id)
);
